n    // box-shadow: inset -2px 0 0 #fff, inset 2px 0 0 #fff;\n    border-radius: 7px;\n\n    &:hover {\n      // box-shadow: inset -0px 0 0 #fff, inset 0px 0 0 #fff;\n    }\n\n    &:active {\n      // background-color: #aaa;\n    }\n  }\n\n  &::-webkit-scrollbar-button {\n    width: 20px;\n    height: 20px;\n    background-color: #0000;\n  }\n}\n\n@mixin flexCol($gap: 0px) {\n  display: flex;\n  flex-direction: column;\n  gap: $gap;\n}\n\n@mixin flexCenter($gap: 0px) {\n  display: flex;\n  align-items: center;\n  justify-content: center;\n  gap: $gap;\n}\n\n@mixin flexRowCenter($gap: 0px) {\n  display: flex;\n  // align-items: center;\n  justify-content: center;\n  gap: $gap;\n}\n\n$background: #eeeeee;\n$main: #ce2127;\n\n//header\n$header-height-small: 50px;\n$header-height-big: 70px;\n$header-heigh: 50px;\n\n@media screen and (min-width: 1280px) {\n  $header-heigh: 70px;\n}\n\n//modal\n$modal-bg-opacity: 0.5;\n$modal-shadow: 0 20px 50px rgba(#000, 0.15);\n\n//fonts\n$sans: \"Euclid Circular A\";\n\n//screen sizes\n$screen-small: 720px;\n$screen-medium: 1024px;\n$screen-big: 1280px;\n$screen-huge: 1800px;\n",".header-main {\n  height: $header-height-small;\n  background-color: rgba($color: #fff, $alpha: 0.9);\n  z-index: 1000;\n\n  display: flex;\n\n  &__menu-small {\n    display: flex;\n    width: 100%;\n    .logo-header {\n      display: block;\n      height: 30px;\n      width: auto;\n      margin: 10px 20px;\n      margin-right: auto;\n    }\n\n    .navigation-main {\n      display: flex;\n      margin-right: 10px;\n\n      &__button {\n        display: flex;\n        align-items: center;\n        transition: all 0.1s;\n        justify-content: center;\n        background-color: #fff0;\n        border-radius: 50%;\n        border: none;\n        width: 50px;\n        height: 50px;\n        text-decoration: none;\n\n        &_location {\n          // @include useIco(\"location.svg\");\n        }\n\n        &_phone {\n          // @include useIco(\"phone.svg\");